<script type="text/javascript">
document.addEventListener("DOMContentLoaded", function() {
    if (!('serviceWorker' in navigator)) return;
    window.__sendTokenToServer = function(token, refresh, onSuccess) {
        var http = new XMLHttpRequest();
        http.onreadystatechange = function() {
            if (this.readyState == 4 && this.status == 200) {
                if ('localStorage' in window) {
                    try {
                        window.localStorage.setItem('_push_notification_token_ts', Math.floor(Date
                        .now() / 1000));
                    } catch (e) {}
                }
                if (typeof onSuccess == 'function') onSuccess.call();
            }
        };
        http.open('POST', '/notification/register/push', true);
        http.setRequestHeader('Content-Type', 'application/json');
        http.send(JSON.stringify({
            token: token,
            refresh: refresh
        }))
    };
    var firebaseConfig = {
        apiKey: "AIzaSyBy_GNCOJjOY6pbYbwH2F2FiHmOVPO9RUQ",
        authDomain: "erodate-9c7fb.firebaseapp.com",
