        projectId: "erodate-9c7fb",
        storageBucket: "erodate-9c7fb.appspot.com",
        messagingSenderId: "490785953026",
        appId: "1:490785953026:web:2535b5127b140e47"
    };
    firebase.initializeApp(firebaseConfig);
