                );
            messaging.onTokenRefresh(function() {
                messaging.getToken().then(function(refreshedToken) {
                    window.__sendTokenToServer(refreshedToken, true);
                });
            });
            if (('Notification' in window) && Notification.permission == 'granted') {
                var ts, refresh = false;
                if ('localStorage' in window) {
                    try {
                        ts = window.localStorage.getItem('_push_notification_token_ts');
                        if (ts) {
                            var dt = new Date(ts * 1000);
                            var now = new Date();
                            refresh = Math.floor((now.getTime() - dt.getTime()) / 1000) >= 14 * 24 *
